function f_gold(x, y, bound) {
    var s = new Set(); // create a new Set to store unique values of i+j
    var i = 1;
    while (i < bound) { // loop through all possible values of i less than bound
        var j = 1;
        while (j < bound) { // loop through all possible values of j less than bound
            if (i + j <= bound) { // if i+j is less than or equal to bound, add it to the Set
                s.add(i + j);
            }
            if (y == 1) { // if y is 1, break out of the inner loop
                break;
            }
            j *= y; // update j to the next power of y
        }
        if (x == 1) { // if x is 1, break out of the outer loop
            break;
        }
        i *= x; // update i to the next power of x
    }
    return Array.from(s).sort((a, b) => a - b); // convert the Set to an array, sort it in ascending order, and return it
}
